import React, {Component} from 'react';
import "./_footer.scss"

class Footer extends Component
{
    render() {
        return (
            <>
                <footer>
                    <div className="container">
                        <div className="footer">
                            <section className="footer-logo">

                            </section>
                            <section className="footer-social">

                            </section>
                        </div>
                    </div>
                </footer>
            </>
        )
    }
}

export default Footer;
